import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Use Routes instead of Switch
import Sidebar from "./SideBar"; // Make sure this is the correct file name
import TimesheetList from "./TimesheetList"; // Your existing timesheet component
import EmployeeManagement from "./EmployeeManagement"; // The new Employee Management page

const App = () => {
  return (
    <Router>
      <div style={{ display: "flex" }}>
        <Sidebar />
        <div style={{ padding: "20px", flex: 1 }}>
          <Routes>
            <Route path="/timesheet" element={<TimesheetList weekDates={["Monday", "Tuesday", "Wednesday"]} />} />
            <Route path="/employee-management" element={<EmployeeManagement />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
